(53, 'Otterbox Defender Back Case For Apple iPhone 6S - Black', '', 'Features:\nMulti-layer case protects your investment from potential damage\nBuilt-in touchscreen protector defends against scratches and scrapes\nPort plugs allow for easy access while keeping out dust and debris\nProtective membrane cradles Touch ID, allowing for full functionality\nSnap-click plastic shell ensures hassle-free on-off installation\nHolster clips onto straps and belts, plus it locks in place for hands-free viewing\n\n\nMaterial:\nTwo-piece internal polycarbonate shell snaps around the iPhone 6 while internal foam padding provides cushioning\nIntegrated screen protector guards against scratches and smudges without affecting touchscreen sensitivity\nOuter synthetic rubber slip cover wraps around the inner shell and absorbs impact from drops and bumps\nIncluded holster swivels in any direction, clips easily to belts and bags ', '', 1, 4500, '3600', '', NULL, NULL, NULL, '', NULL, '', 1, 1, '50206', 'Black', '660543352679', '', 'Back Case, Tough Case', 'Phone', 'Apple iPhone 6S', '', 'Black', '', '', '', '', '', '', '1', '', 'pj_zzwRIEQw', 'Defender', '', '', 'No Warranty', '', '', '', '', '', '', '', '', '', 'Defender 6', '', '', '', '', 0),
